import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { Bar, Doughnut, Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  PointElement,
  LineElement,
  Filler
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  PointElement,
  LineElement,
  Filler
);

const Dashboard = () => {
  const [stats, setStats] = useState(null);
  const [recentTransactions, setRecentTransactions] = useState([]);
  const [budgets, setBudgets] = useState([]);
  const [trendData, setTrendData] = useState([]);
  const [financialGoals, setFinancialGoals] = useState([]);
  const [insights, setInsights] = useState([]);
  const [loading, setLoading] = useState(true);
  const [timeRange, setTimeRange] = useState('month');
  const [activeView, setActiveView] = useState('overview');

  const quickActions = [
    { icon: 'ðŸ’°', label: 'Add Income', link: '/transactions/add?type=income', color: '#22c55e' },
    { icon: 'ðŸ›’', label: 'Add Expense', link: '/transactions/add?type=expense', color: '#ef4444' },
    { icon: 'ðŸŽ¯', label: 'Set Budget', link: '/budgets/add', color: '#8b5cf6' },
    { icon: 'ðŸŽ¯', label: 'Set Goal', link: '/goals/add', color: '#f59e0b' }
  ];

  useEffect(() => {
    fetchDashboardData();
  }, [timeRange]);

  const fetchDashboardData = async () => {
    try {
      const token = localStorage.getItem('token');
      const headers = { 'Authorization': `Bearer ${token}` };

      const [statsRes, transactionsRes, budgetsRes, trendsRes, goalsRes, insightsRes] = await Promise.all([
        fetch('/api/transactions/stats/summary', { headers }),
        fetch('/api/transactions?page=1&limit=8', { headers }),
        fetch('/api/budgets', { headers }),
        fetch(`/api/transactions/trends?range=${timeRange}`, { headers }),
        fetch('/api/financial-goals', { headers }),
        fetch('/api/insights', { headers })
      ]);

      const statsData = await statsRes.json();
      const transactionsData = await transactionsRes.json();
      const budgetsData = await budgetsRes.json();
      const trendsData = await trendsRes.json();
      const goalsData = await goalsRes.json();
      const insightsData = await insightsRes.json();

      setStats(statsData);
      setRecentTransactions(transactionsData.transactions || []);
      setBudgets(budgetsData.budgets || []);
      setTrendData(trendsData.trends || []);
      setFinancialGoals(goalsData.goals || []);
      setInsights(insightsData.insights || []);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`1539532623_81_6_81_60_11`,'Error fetching dashboard data:', error));
    } finally {
      setLoading(false);
    }
  };

  const getFinancialHealthScore = () => {
    if (!stats) return 0;
    const netIncome = stats.netIncome || 0;
    const savingsRate = ((netIncome / (stats.totalIncome || 1)) * 100) || 0;
    return Math.min(100, Math.max(0, savingsRate + 50));
  };

  const getSpendingInsights = () => {
    const insights = [];
    if (stats?.totalExpenses > (stats?.totalIncome * 0.7)) {
      insights.push('Your expenses are high relative to income. Consider reviewing your spending.');
    }
    if (stats?.netIncome > 0) {
      insights.push(`Great! You're saving $${stats.netIncome.toFixed(2)} this period.`);
    }
    if (stats?.totalExpenses < (stats?.totalIncome * 0.3)) {
      insights.push('Excellent savings rate! Consider investing your extra funds.');
    }
    return insights;
  };

  // Enhanced chart data preparation
  const categoryData = {};
  recentTransactions.forEach(transaction => {
    if (transaction.type === 'expense') {
      categoryData[transaction.category] = (categoryData[transaction.category] || 0) + transaction.amount;
    }
  });

  // Chart configuration
  const chartOptions = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: {
      legend: {
        position: 'top',
        labels: {
          usePointStyle: true,
          padding: 15,
          color: '#e2e8f0',
          font: { size: 11 }
        }
      }
    },
    scales: {
      y: {
        beginAtZero: true,
        grid: { color: 'rgba(255, 255, 255, 0.05)' },
        ticks: {
          color: '#94a3b8',
          callback: (value) => '$' + value
        }
      },
      x: {
        grid: { color: 'rgba(255, 255, 255, 0.05)' },
        ticks: { color: '#94a3b8' }
      }
    }
  };

  const barData = {
    labels: Object.keys(categoryData),
    datasets: [{
      label: 'Expenses by Category',
      data: Object.values(categoryData),
      backgroundColor: [
        'rgba(34, 197, 94, 0.8)', 'rgba(59, 130, 246, 0.8)', 'rgba(168, 85, 247, 0.8)',
